import React, { useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

const StyledNav = styled.div`
  background-color: #070814;
  height: 82px;
  width: 1920px;

  & .div-css {
    height: 42px;
    left: 340px;
    position: relative;
    top: 20px;
    width: 1240px;
  }

  & .link {
    height: 22px;
    left: 0;
    position: absolute;
    top: 10px;
    width: 154px;
  }

  & .image {
    background-image: url(./image.png);
    background-position: 50% 50%;
    background-size: cover;
    height: 19px;
  }

  & .list {
    height: 42px;
    left: 863px;
    position: absolute;
    top: 0;
    width: 377px;
  }

  & .item {
    height: 25px;
    left: 0;
    position: absolute;
    top: 8px;
    width: 49px;
  }

  & .link-about {
    color: #ffffff;
    font-family: "Pretendard-Medium", Helvetica;
    font-size: 18px;
    font-weight: 500;
    height: 21px;
    left: 0;
    letter-spacing: -0.18px;
    line-height: 25.2px;
    position: absolute;
    top: 1px;
    white-space: nowrap;
    width: 49px;
  }

  & .link-wrapper {
    height: 25px;
    left: 81px;
    position: absolute;
    top: 8px;
    width: 62px;
  }

  & .text-wrapper {
    color: #ffffff;
    font-family: "Pretendard-Medium", Helvetica;
    font-size: 18px;
    font-weight: 500;
    height: 21px;
    left: 0;
    letter-spacing: -0.18px;
    line-height: 25.2px;
    position: absolute;
    top: 1px;
    white-space: nowrap;
    width: 62px;
  }

  & .div-wrapper {
    height: 25px;
    left: 174px;
    position: absolute;
    top: 8px;
    width: 62px;
  }

  & .item-button {
    background-color: #343744;
    height: 42px;
    left: 268px;
    position: absolute;
    top: 0;
    width: 110px;
  }

  & .div {
    color: #a5b2c5;
    font-family: "Pretendard-Medium", Helvetica;
    font-size: 18px;
    font-weight: 500;
    height: 21px;
    left: 24px;
    letter-spacing: -0.18px;
    line-height: 25.2px;
    position: absolute;
    text-align: center;
    top: 9px;
    white-space: nowrap;
    width: 62px;
  }
`;

export const Header = () => {
  return (
    <StyledNav>
      <div className="div-css">
        <div className="link">
          <div className="image" />
        </div>
        <div className="list">
          <div className="item">
            <div className="link-about">About</div>
          </div>
          <div className="link-wrapper">
            <div className="text-wrapper">모집안내</div>
          </div>
          <div className="div-wrapper">
            <div className="text-wrapper">프로젝트</div>
          </div>
          <div className="item-button">
            <div className="div">지원하기</div>
          </div>
        </div>
      </div>
    </StyledNav>
  );
};
